import React from "react";

import styled from 'styled-components/macro';

const BannerImage = styled.img`
    position: absolute;
    top:0;
    left:0;
    width: 100vw;
    height: 0vh;
    object-fit: cover;
`;


const Rooms = () => {
  return (
    <>
      <BannerImage  src="https://media.nomadicmatt.com/2018/apartment.jpg" alt=""/>
    </>
  );
};

export default Rooms;
